import React, { useState } from 'react';
import axios from 'axios';

function LoginAdminPage({ onLogin }) {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const handleAdminLoginClick = async () => {
        try {
        const response = await axios.post("api/adminlogin", { username, password });
        if (response.status === 200) {
    
            AdminonLogin();
    
            navigate("/adminpage");
        } else {
            setError("Login failed");
        }
        } catch (error) {
        setError("Login Failed, Please check your username and password");
        }}

return (
    <div className="LoginInput">
    <h1 className="LoginH1">Login Page</h1>
    <input type="text" placeholder="Username" value={username} onChange={(e) => setUsername(e.target.value)} />
    <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
    <button className="ButtonLogin" onClick={handleAdminLoginClick}>Login</button>
    </div>
);}

export default LoginAdminPage;
